import React, { useEffect } from 'react';
import './App.css';
import io from 'socket.io-client';

export const socket = io("ws://localhost:5000");

function App() {



  const sendMessage = () => {
    socket.emit('message', 'Hello World!');
  };
  useEffect(() => {

    socket.on('message', message => {
      console.log(message);
    })

    return () => {
      socket.off('message');
    };
  }, []);



  return (
    <div className="App">
    </div>
  );
}

export default App;
